import React from 'react'
import { Col, Row } from 'react-bootstrap'
import Particles from "react-tsparticles"
import '../pages/Contact.css'

const Contact = () => {
    return (

<Row>
    <Col>
    <div className="contact">
    <Particles id="tsparticles" init={particlesInit} loaded={particlesLoaded} options={{
        fpsLimit: 60,
        interactivity: {
          events: {
            onClick: {
              enable: true,
              mode: "push",
            },
            onHover: {
              enable: true,
              mode: "repulse",
            },
            resize: true,
          },
          modes: {
            bubble: {
              distance: 400,
              duration: 2,
              opacity: 0.8,
              size: 40,
            },
            push: {
              quantity: 4,
            },
            repulse: {
              distance: 200,
              duration: 0.4,
            },
          },
        },
        particles: {
          color: {
            value: "#ffffff",
          },
          links: {
            color: "#ffffff",
            distance: 150,
            enable: true,
            opacity: 0.5,
            width: 1,
          },
          collisions: {
            enable: true,
          },
          move: {
            direction: "none",
            enable: true,
            outMode: "bounce",
            random: false,
            speed: 6,
            straight: false,
          },
          number: {
            density: {
              enable: true,
              value_area: 800,
            },
            value: 80,
          },
          opacity: {
            value: 0.5,
          },
          shape: {
            type: "circle",
          },
          size: {
            random: true,
            value: 5,
          },
        },
        detectRetina: true,
      }}/>
            <h1>Talk to me.</h1>
            <br />
            <br />
            <a className="tags" href = "mailto: mwasifu@outlook.com">Email Me</a>
            <br />
            <br />
            <h4 className="profile">Check out my profiles</h4>
            <br />
            <a className="tags" href="https://www.linkedin.com/in/mohammed-wasif-uddin-10b6b1201/">LinkedIn</a>
            <br />
            <br />
            <a className="tags" href="https://github.com/mwasifu?tab=repositories">Github</a>
            <br />
            <br />
            <h4>Follow me on  <a className="tags" href="https://www.instagram.com/mwasifu/"> Instagram </a></h4>
        </div>
    </Col>
</Row>


    )
}

export default Contact
